import React from "react";

const About = () => {
  return (
    <>
      <h1> WELCOME </h1>
      <h2>SpartantMeetup creates possibilities </h2>
      <p>
        {" "}
        SpartantMeetup is a platform for finding and building local communities.
        People use Meetup to meet new people, learn new things, find support,
        get out of their comfort zones, and pursue their passions, together.{" "}
      </p>
    </>
  );
};

export default About;
